// src/pages/delivery/AvailableOrders.jsx
import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import axios from 'axios';
import { useAuth } from '../../context/AuthContext';
import '../../styles/delivery/AvailableOrders.css';

const AvailableOrders = () => {
  const { user } = useAuth();
  const [availableOrders, setAvailableOrders] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    const fetchAvailableOrders = async () => {
      try {
        setLoading(true);
        const token = localStorage.getItem('token');

        // Use proper API endpoint with correct token configuration
        const response = await axios.get('http://localhost:8080/api/delivery/available-orders', {
          headers: {
            Authorization: `Bearer ${token}`
          }
        });

        setAvailableOrders(response.data || []);
        setLoading(false);
      } catch (err) {
        console.error('Error fetching available orders:', err);
        setError('Failed to fetch available orders. Please try again later.');
        setLoading(false);
      }
    };

    fetchAvailableOrders();

    // Set up polling to refresh the list every 30 seconds
    const interval = setInterval(fetchAvailableOrders, 30000);
    return () => clearInterval(interval);
  }, []);

  const handleAcceptOrder = async (orderId) => {
    try {
      const token = localStorage.getItem('token');

      await axios.post(`http://localhost:8080/api/delivery/orders/${orderId}/accept`, {}, {
        headers: {
          Authorization: `Bearer ${token}`
        }
      });

      // Redirect to the delivery order page
      window.location.href = `/delivery/order/${orderId}`;
    } catch (err) {
      console.error('Error accepting order:', err);
      setError('Failed to accept order. Please try again.');
    }
  };

  if (loading) {
    return (
      <div className="available-orders-container">
        <div className="loading-message">Loading available orders...</div>
      </div>
    );
  }

  if (error) {
    return (
      <div className="available-orders-container">
        <div className="error-message">
          <h3>Error</h3>
          <p>{error}</p>
          <button 
            className="reset-filters-button"
            onClick={() => window.location.reload()}
          >
            Try Again
          </button>
        </div>
      </div>
    );
  }

  return (
    <div className="available-orders-container">
      <div className="available-orders-header">
        <h1>Available Orders</h1>
        <p>These orders are ready for pickup and delivery</p>
      </div>

      {availableOrders.length === 0 ? (
        <div className="no-orders-message">
          <p>No orders available for delivery at this time.</p>
          <p>Check back soon or refresh the page.</p>
          <button 
            onClick={() => window.location.reload()} 
            className="reset-filters-button"
          >
            Refresh
          </button>
        </div>
      ) : (
        <div className="orders-list">
          {availableOrders.map((order) => (
            <div key={order.id} className="order-card">
              <div className="order-card-header">
                <h3>Order #{order.id}</h3>
                <span className="order-id">{new Date(order.createdAt).toLocaleString()}</span>
              </div>

              <div className="order-card-details">
                <div className="detail-row">
                  <span className="detail-label">Restaurant:</span>
                  <span className="detail-value">{order.restaurantName}</span>
                </div>
                <div className="detail-row">
                  <span className="detail-label">Items:</span>
                  <span className="detail-value">{order.orderItems.length} items</span>
                </div>
                <div className="detail-row">
                  <span className="detail-label">Address:</span>
                  <span className="detail-value">{order.deliveryAddress}</span>
                </div>
                {order.specialInstructions && (
                  <div className="detail-row">
                    <span className="detail-label">Notes:</span>
                    <span className="detail-value">{order.specialInstructions}</span>
                  </div>
                )}
              </div>

              <div className="order-card-footer">
                <div className="order-amount">
                  <span className="amount-label">Order Total:</span>
                  <span className="amount-value">${parseFloat(order.total).toFixed(2)}</span>
                </div>
                <div className="delivery-fee">
                  <span className="fee-label">Delivery Fee:</span>
                  <span className="fee-value">${parseFloat(order.deliveryFee).toFixed(2)}</span>
                </div>

                <button
                  onClick={() => handleAcceptOrder(order.id)}
                  className="accept-order-button"
                >
                  Accept Delivery
                </button>
              </div>
            </div>
          ))}
        </div>
      )}
    </div>
  );
};

export default AvailableOrders;
